INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('11499','bookdesc10','0','数据表_书籍','\\N','\\N','记录中土世界各种美食的奇书。尽管中土世界被认为是一个虚构的幻想世界，但由于资料的系统与详实，吸引了一大批研究爱好者，并相信“天下之大，无菜不有”。','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('11500','bookdesc11','0','数据表_书籍','\\N','\\N','记载了大量银河系食谱的数据，作者不详，书也只写了一半，专家们推断作者是半路撑死的，理由是书的末尾提到了一颗蓝色的星球。','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('11501','bookdesc12','0','数据表_书籍','\\N','\\N','自称可以穿越时空的美食专栏作家杜勒艾蒙撰写的热销书，提出了宇宙就是一个大型食品袋的理论。书中有超过80%的篇幅记录的是他从各个时空收集到的豆沙包。','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('11502','bookdesc13','0','数据表_书籍','\\N','\\N','讲述一群热血的锻造师为了帮助勇者打败为害人间的恶龙，到处收集神奇石头打磨戒指的故事。书中提到的很多法术咒语，一直为后人研究，成为一门学问，人称“磨学”。','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('11503','bookdesc14','0','数据表_书籍','\\N','\\N','著名学者牛比德肯试图用科技的理论去解释魔法，并提出“魔技”的概念，并考证历史上被禁止一些被禁止的科学研究，其实就是“魔技”。','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
