INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('11505','bookdesc16','0','数据表_书籍','\\N','\\N','由天才镇非著名小学老师谢勒戈顿编写的科普读物，用第一人称的视角，通过亲身经历的事件去解释科学现象，但因为内容过于苦涩而被家长投诉，被当成笑话的同时，也被一些学者视为奇书。','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
