INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('15723','tooltips_gymDesc','0','数据表_UI文字','\\N','\\N','● 安排天才玩游戏，可以获得大量斗币<br/>● 推荐给路人进行游戏，可以获得大量金币<br/>●  研究所等级越高，奖励也越多<br/>● 天才或路人玩喜欢的游戏，奖励也会更多，遇到大方的路人更有额外的惊喜','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('15724','tooltips_readDesc','0','数据表_UI文字','\\N','\\N','● 安排天才读书，可以获得大量的经验<br/>● 研究所等级越高，读书获得的经验越多<br/>● 研究所等级越高，解锁的图书也越多<br/>● 天才有自己的偏好图书，喜欢的书效率会更高<br/>● 读同一本书久了会影响心情导致效率降低','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('15725','tooltips_schemeDesc','0','数据表_UI文字','\\N','\\N','● 每个天才可以装备一个道具<br/>● 天才与道具都可以通过长按拖动到指定位置进行替换<br/>● 在“技能”中设置战斗时自动施放技能的顺序','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
INSERT INTO `tc_i18n` (`id`, `key`, `platform`, `category`, `server_special`, `client_special`, `zh`, `en`, `ja`, `de`, `ru`, `fr`, `es`, `du`, `ko`, `it`, `hu`, `pt`, `ar`, `no`, `tw`, `hk`) VALUES ('15726','tooltips_smeltDesc','0','数据表_UI文字','\\N','\\N','● 升级道具可以提升基础属性<br/>● 不同品质的道具等级上限不同<br/>  绿色品质上限8级<br/>  蓝色品质上限12级<br/>  紫色品质上限16级<br/>  橙色品质上限20级<br/>● 每4级将提升一次附加属性<br/>● 融合同名的道具会获得双倍的基础经验','','','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N','\\N');
